54f0f73b-4135-4673-8863-07eccf1ff778.template:
{{#unless type}}
  <li>Missing "type"</li>
{{/unless}}
{{#if (eval type "==" "ot")}}
  {{#unless heading}}
    <li>Missing "heading"</li>
  {{/unless}} 
  {{#unless access}}
    <li>Missing "access"</li>
  {{/unless}}
  {{#if (eval access "!=" "not-accessible")}}
    {{#if (hasOutlinks "satisfies")}}
      {{#unless (eval access "==" "read-only")}}{{#unless (eval (countOutlinks "satisfies") ">" "1")}}
        <li>Missing 2nd "satisfies" link</li>
      {{/unless}}{{/unless}}
    {{else}}
      <li>Missing "satisfies" link</li>
    {{/if}}
  {{else}}
    {{#if (hasOutlinks "satisfies")}}
      <li>Invalid "satisfies" link</li>
    {{/if}}
  {{/if}}
{{/if}}
